    const navigate = useNavigate()
    const location = useLocation()
    const [count,setCount] = useState(3)
    useEffect(()=>{
        const intervel = setInterval(() => {
            setCount((currentCount) => --currentCount);
        }, 1000);
        navigate('/login',{
            state: location.pathname,
        })
        return () => clearInterval(intervel)

    },[count])
